import React from 'react';
import './style.css';

function App() {
  return (
    <div className="homepage">
      <div className="navbar">
        <div className="logo">Courses Webpage</div>
        <a href="/login" className="login-btn">Login</a>
      </div>
      <div className="main-content">
        <a href="/python" className="course-link">Python</a>
        <a href="/docker" className="course-link">Docker</a>
        <a href="/java" className="course-link">Java</a>
        <a href="/javascript" className="course-link">JavaScript</a>
        <a href="/mongo" className="course-link">MongoDB</a>
        <a href="/sql" className="course-link">SQL</a>
        <a href="/react" className="course-link">React</a>
      </div>
    </div>
  );
}

export default App;
